import styled from 'styled-components';

export const Aside = styled.aside`
  width: 100%;
  min-height: 100%;
  background-color: red;

  padding: 5rem 5rem;

  ul {
    li:not(:last-child) {
      margin-bottom: 2rem;
    }
  }
`;
